"use strict";

function findMaxLength(nums) {
    let s = 0, ans = 0;
    const mp = new Map([[0, -1]]);
    for (let i = 0; i < nums.length; i++) {
        s += nums[i] === 1 ? 1 : -1;
        if (mp.has(s)) {
            ans = Math.max(ans, i - mp.get(s));
        } else {
            mp.set(s, i);
        }
    }
    return ans;
}
